import React from "react";

// Components
import Tiktok from "../components/Tiktok";

//import database
import { media_list } from "../data/media_list";

const Home = () => {
  return (
    <div>
      <Tiktok social_media_name="TikTok" />

      <Tiktok social_media_name="Instagram" />

      {media_list.map((item, key) => {
        return (
          <ul key={key}>
            <li>
              {key + 1}.
              <a href={item.link} target="_blank">
                {item.link}
              </a>
            </li>
          </ul>
        );
      })}
    </div>
  );
};

export default Home;
